import React from 'react';

import { Grid, } from '@mui/material';
import TrafficMap from '../TrafficMap/TrafficMap';

export default function ResortDetail(props) {
   return (
      <Grid container spacing={2} style={{
         padding: '2.4rem 4.8rem'
      }}>
         <Grid item xs={4}>Ski Resort misc. data goes here</Grid>
         <Grid item xs={8} style={{
            display: 'flex',
            justifyContent: 'end',
            alignItems: 'start',
         }}>
            <TrafficMap resortName={props.resortData.name}
               mapMode={'place'}
               lat={props.resortData.ll[1]}
               long={props.resortData.ll[0]} />
         </Grid>
         <Grid item xs={4}>Lift Status goes here</Grid>
         <Grid item xs={8}>Twitter Feed goes here</Grid>
      </Grid>
   );
}
